    value: 'The payments on Schedule H4 Line 21a for ITEMIZE: health insurance, net
      pay and payroll taxes were activities for employees who spent 25% or less of
      their time during the period referenced above on FEA or activities in connection
      with a Federal election.  On Schedule H4, on 12/10/08, a reimbursement in the
      amount of $417.15 was made to Johnnie Bellamy.  The memo entries that are associated
      with that reimbursement are: a mileage reimbursement of $232.44 made out to
      her, $36.39 to the U.S. Postmaster, $47.30 to Staples and $101.20 to Pilot.  The
      mileage reimbursement was not inputted as a memo entry on the original report
      and should have been.  We have amended the report to fix this error.  The expenditures
      on Schedule H4 made for food & beverage, FOOD & BEVERAGE, ITEMIZE: PARK RENTAL
      and ITEMIZE: EQUIPMENT RENTAL did not promote, support, attack or oppose any
      specifically identified candidate and were not associated with any fundraising
      activity.  They were for volunteer training events, a political rally for a
      county party with non-federal candidates, and computer equipment rented for
      regular office and party building activities.  The ending cash on hand for this
      report decreased due to an amendment to the October Monthly report filed on
      March 2, 2009.  We will be filing an amended 2009 February Monthly report as
      well.'
